- input: "TEXT\x1CC00029504\x1C25969659\x1C\x1CF3XN\x1C\"RECEIPTS: The Engineers Political
    Education Committee (EPEC) Voluntary Fund received a candidate refund check from
    Walsh for Congress Committee, check number 8021 for $2,500 deposited 7/30/08.
    In January 2008 EPEC contributed $2,500 for Jim Walsh's 2008 general election
    campaign. Because Mr. Walsh decided to retire, he has refunded the contribution.
    EPEC and its affiliated PACs exceeded the 2008 general election contribution limit
    to Friends of Jim Oberstar. On 6/13/08 EPEC requested a $500 refund. On 7/30/08
    check number 10033 for $500 was deposited in the EPEC Voluntary account. EPEC
    and its affiliated PACs exceeded the 2008 primary election contribution limit
    to Carney for Congress. On 6/13/08 EPEC requested a $200 refund. On 7/30/08 check
    number 3062 for $200 was deposited in the EPEC Voluntary account. DISBURSEMENTS:
    On 6/30/08 a $10,000 check intended for the EPEC Education Fund was erroneously
    deposited into the EPEC Voluntary Fund bank account. On 7/09/08 the EPEC Voluntary
    Fund wrote check number 7988 for $10,000 to the EPEC Education Fund. This disbursement
    appears on Line 29 of the FEC report. In March 2008 Laney, Inc., a member employer,
    used an incorrect calculation when it forwarded members' EPEC contributions. The
    overpayment was refunded with interest in the form of check number 7989 for $181.78
    dated 7/09/08. This disbursement appears on Line 29 of the FEC report.\""
